        TreeNode* result = root;
        int leftOrRight = -1;
        // 找到当前节点
        while (node != nullptr)
        {
            if(node->val == key){
                break;
            } else if(key > node->val){
                leftOrRight = 1;
                pre = node;
                node = node->right;
            }else{
                leftOrRight = 0;
                pre = node;
                node = node->left;
            }
        }
    //printf("val =%d ",node->val);
    // 数字不存在
