      return root;
    // 找到数字后将其删除
    // 是顶点
    //    没有子树
    //    仅有一个子树
    //    两个子树
    // 不是顶点
    //    没有子树
    //    仅有一个子树
    //    两个子树
    TreeNode* l=node->left;
    TreeNode* r=node->right;

    if(node==root){
      if(l==nullptr&&r==nullptr)
        return nullptr;
      if(l==nullptr)
        return r; 
      if(r==nullptr)
        return l;
      TreeNode* newRoot=l;
      while(l->right!=nullptr){
        l=l->right;
      }
      l->right=r;
      return newRoot;
    } else {
      if(l==nullptr&&r==nullptr){

        if(leftOrRight==0){
          pre->left=nullptr;
        }
        if(leftOrRight==1){
          pre->right=nullptr;
        }

        return root;
      }
      if(l==nullptr){
        if(leftOrRight==0){
          pre->left=r;
        } else {
          pre->right=r;
        }
        return root;
      }
      if(r==nullptr){
        if(leftOrRight==0){
          pre->left=l;
        } else {
          pre->right=l;
        }
      return root;
      }
      // 直接将左子树接上去,右子树放到左子树的最大键值的右子树
      if(leftOrRight==0){
        pre->left=l;
      } else {
        pre->right=l;
      }
      while(l->right!=nullptr){
        l=l->right;
      }
      l->right=r;
      //printf("new l val = %d ",l->val);

        return root;
    }

  }
};

